Okay, let's write some Rust! Delete the code in src/main.rs, and replace it with this: #![feature(panic_handler)]
#![feature(core_intrinsics)]
#![no_std]
#![no_main] extern crate bootloader_precompiled; use core::intrinsics;
use core::panic::PanicInfo; #[panic_handler]
#[no_mangle]
fn panic(_info: &PanicInfo) -> ! { unsafe { intrinsics::abort() }
} #[no_mangle]
pub fn _start() -> ! { loop {}
} Let's go over the code, bit by bit: // ... #![no_std]
#![no_main] // ... These two attributes tell Rust, "hey, we don't want a standard library, and we don't want a main function." When writing an OS, we want full control over the details. The Rust standard library assumes that an operating system exists, and we don't have any of that yet, so we can't use it. Rust's default main includes stuff that we could use, but it's nicer to write our own, so we have that full control. #![feature(panic_handler)]
#![feature(core_intrinsics)] // ... extern crate bootloader_precompiled; use core::intrinsics;
use core::panic::PanicInfo; #[panic_handler]
#[no_mangle]
fn panic(_info: &PanicInfo) -> ! { unsafe { intrinsics::abort() }
} When we don't include the standard library, then we're missing one important thing: if we panic!, Rust wants to call a callback before aborting. This is that callback. All we do is abort our program. The extern crate line will set up our bootloader, that is, the code that loads our OS after the computer starts up. We'll talk more about this later. Other than that, this is boilerplate. We'll talk about this stuff more when we actually do something on panics; for now, don't worry about it. // ... #[no_mangle]
pub fn _start() -> ! { loop {}
} This is our main function, even though it's named _start. Have you ever wondered how main gets called? Technically, _start gets called first, then that calls your main function. Any setup code goes in _start, and would run before it calls main. Let's explain this function in a bit more detail. The #[no_mangle] attribute says "hey Rust, it's really important that this function is named exactly this." You see, Rust is free to rename functions for you. There's good reasons for this that we won't get into here. This attribute disables that. If Rust renamed this function, then we wouldn't be able to boot up properly. We'll explain more in the next section. The ! return type means we never return, and we never return because the only thing we do is loop forever! With this code, our little kernel will start, and then do nothing. It's a start!

